linkster={config:0,init:function(b){linkster.config=b;if(linkster.isJquery()==0){alert("Linkster dependencies : \n\nNo Jquery Found.")}else{linkster.register()}},isJquery:function(){if(typeof jQuery=="undefined"){return 0}else{return 1}},register:function(){$("a").on("click",linkster._click)},_click:function(b){href=$(this).attr("href");hostName=linkster.getHostname(href);_domainExists=linkster.domainExists(hostName);if(_domainExists){alert(href+"\n\n Url has been blocked, contact site admin.\n\nBlocked by linkster.js");return false}else{return true}},getHostname:function(b){a=document.createElement("a");a.setAttribute("href",b);hostName=a.hostname;delete a;return hostName},domainExists:function(b){return jQuery.inArray(b,linkster.config)==-1?0:1}};